import React from "react";
import PropTypes from "prop-types";

const SendSolution = ({
  result,
  taskStatus,
  answers,
  description,
  sendSolution,
  resolved,
  error,
  toUpdate,
  checkAnswer,
  setChekAnswers,
}) => {
  return (
    <div>
      {resolved ? (
        <>
          {toUpdate ? (
            <>Zadanie wysłano do weryfikacji</>
          ) : (
            <>
              <p>Zadanie rozwiazane</p>
            </>
          )}
        </>
      ) : (
        <>
          {checkAnswer && (
            <>
              {error.length > 0 && <div>{error}</div>}
              {Object.keys(answers).length == result ? (
                <div>
                  <p>Dobra odpowiedź</p>
                  <button onClick={() => sendSolution()}>
                    Prześlij rozwiązanie
                  </button>
                </div>
              ) : (
                <div>
                  <p>Zła odpowiedź</p>
                  <button onClick={() => sendSolution()}>Prześlij</button>
                  <button onClick={() => sendSolution(true)}>
                    Wyślij prośbe o weryfikacje
                  </button>
                </div>
              )}
            </>
          )}
        </>
      )}
    </div>
  );
};

export default SendSolution;
